import React, { Component } from 'react';

class JoinComponent extends Component {

  render() {

    return(
      <React.Fragment>
        <h2>Join</h2>
        <form>
          <input type='text' />
          <input type='submit' value='Join' />
        </form>
      </React.Fragment>
    );
  };

};

export default JoinComponent;
